import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import AccueilConnecte from './pages/AccueilConnecte';

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<AccueilConnecte />} />
      </Routes>
    </BrowserRouter>
  )
};

export default App;
